(294, 108, 'Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estndar de las industrias desde el ao 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido us una galera de textos y los mezcl de tal manera que logr hacer un libro de textos especimen. No slo sobrevivi 500 aos, sino que tambien ingres como texto de relleno en documentos electrnicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creacin de las hojas \"Letraset\", las cuales contenian pasajes de Lorem Ipsum, y ms recientemente con software de autoedicin, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.\n\nPor qu lo usamos?\nEs un hecho establecido hace demasiado tiempo que un lector se distraer con el contenido del texto de un sitio mientras que mira su diseo. El punto de usar Lorem Ipsum es que tiene una distribucin ms o menos normal de las letras, al contrario de usar textos como por ejemplo \"Contenido aqu, contenido aqu\". Estos textos hacen parecerlo un espaol que se puede leer. Muchos paquetes de autoedicin y editores de pginas web usan el Lorem Ipsum como su texto por defecto, y al hacer una bsqueda de \"Lorem Ipsum\" va a dar por resultado muchos sitios web que usan este texto si se encuentran en estado de desarrollo. Muchas versiones han evolucionado a travs de los aos, algunas veces por accidente, otras veces a propsito (por ejemplo insertndole humor y cosas por el estilo).', NULL, NULL, NULL, '2020-01-15 20:22:35', '2020-01-15 20:22:35'),
